column12:
[Ingeniero Químico de la Universidad Nacional de Colombia con amplia experiencia en el sector de fragancias y químicos para las diferentes industrias de consumo. Se ha desempeñado de manera exitosa en cargos comerciales y de asesoría,  también cuenta con una gran experiencia en el campo de la Ingeniería de Procesos. 

Es una persona profesional, amable, trabajadora, dinámica en las actividades, con excelentes relaciones interpersonales, con gran elocuencia y altas capacidades de trabajo en equipo e individual, amante de los retos y desafíos con un perfil de liderazgo marcado, con las capacidades necesarias para resolver problemas eficientemente y lograr las metas trazadas por la organización.

]

[Ingeniero Electricista, Magister en Administración de empresas, Especialista ingeniería gerencial, 5 años de experiencia en Industria automotriz y alimenticia. Amplio conocimiento en proyectos y diseños de autopartes. Participación en equipos de mejora continua.

Experiencia en la ejecución y evaluación evolutiva de proyectos multidiciplinarios en la industria alimenticia y autopartista,  conocimientos en el área de instrumentación  industrial y procesos de Oil & Gas. Habilidades para trabajar en equipo  activamente, manejo de personal, coordinación de labores logísticas y actividades, proactividad para la solución de problemas,capacidad de aprendizaje y trasmision del conocimiento, buen nivel de adaptabilidad ante cambios. Experiencia laboral en plantas industriales, áreas de Servicio al Cliente y gestión de proyectos. Pensamiento logico para el analisis y solucion de problemas. 
]

[Profesional en ingeniería mecánica de la Universidad Nacional de Colombia, con experiencia en diseño mecánico, diseño y análisis de sistemas térmicos, eficiencia energética, planeación y supervisión de producción y de mantenimiento para maquinaria industrial, análisis tecno económicos de diferentes tipos de sistemas, planeación y control de proyectos. Con manejo en ciencia de datos (EDA, ETL, NLP, Designing Experiments, ML), en desarrollo de modelos para la predicción y clasificación de variables.
Por otra parte, estoy realizando una maestría en la Universidad Nacional de Colombia, con énfasis en el uso de energías renovables la cual me ha brindado sólidos conocimientos en modelación de sistemas, evaluaciones tecno económicos, análisis de ciclo de vida y optimización de procesos. Adicionalmente me estoy certificando en sistemas de gestión de la energía ISO 50001 y auditoria interna de sistemas de gestión ISO 19011. Tengo un énfasis en el uso de ciencias de datos y aprendizaje de máquina para la solución de problemas en diferentes campos de la ingeniería y optimización en diferentes áreas de la planeación y control de proyectos

]

[Ingeniero mecánico especializado en la fabricación y desarrollo de productos nuevos y mejoras en productos de línea, con excelentes habilidades en software 3D, tales como Inventor, Solidworks o Ansys. Enfocado en innovación, buen uso de recursos y cuidado del medio ambiente. Experiencia en proyectos de la industria manufacturera, específicamente en metal mecánica, desarrollando máquinas de diversos tipos en áreas como la producción de alimentos concentrados para animales, equipos filtrantes, y equipos metro lógicos . Excelentes relaciones personales, buen trabajo en equipo, atención a detalles y comprometido.

Mechanical engineer specialized in fabrication and development of products, with excellent abilities on 3D software, like Inventor, Solidworks or Ansys. Focus in innovation, best use of materials, practical process and environmental preservation. Experience in project management in the steel industry, making machines involved in the production of animal feeding. Excellent relationships, good teamwork, attention to details  and commitment. 
]

[Ingeniero Químico con experiencia e interés en el área de sistemas de gestión y garantía de calidad administrado en plataforma ERP (Infor LX), con capacidad de liderazgo, análisis de problemas, planteamiento de soluciones y actitudes para trabajo bajo presión en equipos multidisciplinarios.

Experiencia en cromatografía líquida (HPLC), montaje y producción de biocombustibles de primera y segunda generación, caracterización de residuos lignocelulósicos, técnicas de básicas de laboratorio, normas BPM, BPL y BPD, validación de software, procesos, cadena de frío, limpieza y llenados asépticos y calificación de áreas, equipos de laboratorio de análisis y planta farmacéutica.
]

[Soy Ingeniera Química egresada de la Universidad Nacional de Colombia y Auditora Interna en Buenas Prácticas de Manufactura y Sistema HACCP, así como en Sistemas Integrados de Gestión HSEQ, con experiencia como Analista Físicoquímica en Laboratorio de Control de Calidad de la industria farmacéutica, Ingeniera de Investigación y Desarrollo de Productos e Ingeniera de Control de Calidad en la industria alimentaria, y asistente de investigación en un grupo de la Universidad Técnica de Múnich, Alemania. Experiencia en desarrollo de productos, implementación del Manual de Buenas Prácticas de Manufactura y Plan HACCP, análisis de componentes en HPLC, así como en optimización de reacciones de hidrólisis enzimática y cultivos de bacterias con su respectiva identificación por medio de extracción de ADN.
Altamente responsable, autónoma y aplicada, con aptitudes para el liderazgo y el trabajo en equipo y una amplia formación en bioquímica e ingeniería de bioprocesos. Facilidad de aprendizaje y comprensión de algún tema propuesto referente a ingeniería de procesos. Capacidad de auto aprendizaje y auto estudio.

]

[Ingeniero Mecánico con un año de experiencia como ingeniero de proyectos, en el campo de refrigeración industrial en empresa líder de dicho ámbito, y como practicante en el área de termoformado e inyección de plásticos, egresado de la Universidad Nacional de Colombia, capacitado en parámetros de inyección de polímeros, con formación adicional en sistemas hidráulicos, turbo maquinaria, motores, energías renovables, elementos finitos e innovación. 
Dominio avanzado de Inglés.

Competente en programas CAD, Office y nivel básico en programas de diseño gráfico; 
Posee creatividad, adaptabilidad, trabajo en equipo, capacidad analítica, visión crítica, alto grado de cultura general y curiosidad, complementa el perfil con habilidades artísticas en dibujo.  Persona de múltiples capacidades.

Interés especial en las áreas de diseño mecánico y desarrollo de producto.
]

[Ingeniero Agrícola con enfoque en las áreas de bioclimática en instalaciones agroindustriales, diseño y automatización de sistemas de riego, implementación de BPA’s, protocolos de beneficio de café. Cuento con conocimientos avanzados de herramientas ofimáticas, aplicativo CERPER-2 el cual permite calcular la masa de café pergamino seco, el factor de rendimiento, el precio por carga de CPS incluyendo bonificaciones o castigos según sea el caso, AutoCAD y ERP’s.

Tengo interés en desempeñar labores en campo relacionadas con brindar asistencia técnica y fomentar la transferencia de conocimiento y tecnología a los productores. Cuento con capacidad de trabajo en equipo, toma de decisiones, aprendizaje rápido, orientación al logro y autonomía en la ejecución de proyectos enfocados a la innovación y el desarrollo en  prácticas agrícolas.
]

[Ingeniero Químico con experiencia en procesos y procedimientos de control de calidad; a la vez se poseen conocimientos técnicos y legales en tratamiento de aguas potables y residuales, procesamiento de alimentos, y conocimientos básicos de logística, administración y costos. Persona hábil, enfocada a la eficiencia en las labores asignadas y con capacidad de hallar soluciones sobre la marcha.

Como complemento a estas habilidades, se poseen buenos conocimientos químicos y matemáticos, en software de simulación de procesos químicos (Aspen y HYSIS) y en herramientas ofimáticas.
]

[Como profesional en ingeniería eléctrica y tecnóloga mecatrónica, Cuento con experiencia en labores de interventoría en proyectos de  zonas rurales no interconectadas, documentación de proyectos eléctricos, diseño de instalaciones eléctricas y estudios de fotometría. Análisis de fallas debido a descargas atmosféricas en redes de media tensión en el programa ETAP. Poseo conocimientos básicos en monitoreo de redes eléctricas con sistemas SCADA, procedimientos de seguridad eléctrica e inspección de riesgo eléctrico en instalaciones de media tensión. 

A largo de mi carrera profesional también he desarrollado conocimientos en programas como PHP, JAVA y HTML, aplicándolos en varios proyectos personales y en el área de investigación. Actualmente me encuentro aprendido de forma autónoma y me gustaría aplicar dichos conocimientos como desarrolladora.

]

[Profesional en Ingeniería de Sistemas y Computación de la Universidad Nacional de Colombia con conocimiento en gestión de proyectos de desarrollo de software y redes de computadores.Cuento con conocimiento y experiencia en metodologías de desarrollo ágil con Scrum, y aplicando mejores prácticas del framework COBIT para el gobierno de tecnología y utilizando el framework ITIL para la gestión de servicios TI.

Creativo, con iniciativa y capacidad para la identificación, diseño e implementación de soluciones informáticas aplicando herramientas de las ciencias de la computación. Como parte del rol de líder de proyectos, he desarrollado aptitudes para el liderazgo de equipos, dinamismo en la resolución de problemas, manejo y resolución de conflictos, adaptabilidad al cambio, gestión de situaciones de alta presión y plena disposición de aprendizaje constante.
]

[I am a Mechanical Engineer from the Universidad Nacional de Colombia (National University of Colombia), I have experience in equipment design, hydraulic networks and renewable energies. Also I have knowledge in predictive maintenance in industry. I am specialized in computer software like Autodesk Inventor, Solid Works, Solid Edge, AutoCad, ArcGis and WaterCAD.

I characterize myself as a responsible person committed to achieving goals, willing to learn and do teamwork. I have high analytical skills, I am a solution provider and, in a professional level, I seek to be continually updated.
]

[B.S. in Mechatronics engineering - National University of Colombia with knowledge in software-hardware development mainly focused on embedded systems, robotics and automated systems.

I speak three languages, Spanish (Mother tongue), English and French, a one year international experience in France during for an academical exchange in INSA-Lyon and internship in Schlumberger in Paris as a software developer.
]

[“Constant adaptation”

For me one of the most important skills in a person and a team is the ability to adapt to constantly changing environments, the world and the industries are dynamic systems, therefore you and your team have to be able to adapt and foresee those changes in order to achieve your goals.

“The measure of intelligence is the ability to change.”
― Albert Einstein

Experience:
- Project Management;
- Manufacturing Engineering;
- Lean Manufacturing;
- Data Analysis.]

[Ingeniero Industrial de la Universidad Nacional de Colombia,  con gran interés y formación académica en gestión organizacional, manejo de conocimientos enfocados al fortalecimiento y crecimiento de la competitividad empresarial como, control de procesos de producción y de servicio, gestión de la cadena de suministro, logística, finanzas corporativas y gestión de proyectos. Cuento con aptitud para la programación y  buenas bases estadísticas.

Profesional con sentido humano, liderazgo, facilidad para el trabajo en equipo, creativo para la solución de problemas, colaborador, honesto, puntual y con todo el deseo de brindar su potencial laboral y humano. 
]

[Me destaco en el liderazgo en la formulación y ejecución de proyectos académicos y ambientales con énfasis en manejo de laboratorio, diseño de experimentos y control bajo parámetros de ISO 9001 y de ISO 14001, llevados a cabo en el Instituto Técnico Industrial Pascual Bravo de Medellín. Además, la ejecución de proyectos comunitarios con el Resguardo Indígena de San Juan en el departamento de Nariño y las prácticas de investigación en el Laboratorio de bebidas de GIVUADAN Colombia enfocado en el análisis de materias primas y producto terminado. 

Profesional con capacidad de aprendizaje continuo en diferentes áreas, con competencias para el trabajo colaborativo y en equipo, con excelentes habilidades comunicativas y creatividad para diseñar y ejecutar iniciativas con responsabilidad, disciplina, honestidad y sentido social.
]

[Ingeniero químico de la Universidad Nacional de Colombia, con experiencia en el campo industrial de alimentos, apoyando investigaciones en laboratorio. Capacitado para desempeñarme en la formulación, planeación y ejecución técnica de proyectos, así como para poder determinar los métodos que garanticen la calidad de los productos. 

También he podido participar en proyectos de investigación formando parte de un equipo interdisciplinario.
]

[Ingeniero Agrícola apasionado por el mundo de la agricultura y la alimentación. Mi formación en la Universidad Nacional de Colombia me ha brindado una sólida base en la ciencia agrícola y una profunda comprensión de los desafíos y oportunidades que enfrenta este sector en constante evolución.

He tenido el privilegio de contribuir en la organización y promoción de dos de los eventos más relevantes en el mundo agroindustrial y de la alimentación: AGROEXPO y ALIMENTEC. Estas ferias representan una plataforma fundamental para conectar a productores, empresarios y profesionales del sector, fomentando la innovación, el conocimiento y la generación de oportunidades de negocio.

]

[Ingeniero Quimico con gran capacidad. Capaz de concebir, diseñar, implementar y gestionar procesos de transformación física, química y biológica de la materia prima, con el fin de obtener productos con mayor valor agregado, con responsabilidad social, ambiental y económica. 

Con compromiso por los retos, y ganas de aportarle al lugar de trabajo, siendo propositivo, activo, y alegre en el desarrollo de actividades en grupo e individuales, dando valor agregado al trabajo desarrollado por la empresa. Con gran gusto por el área de los polímeros y los alimentos.
]

[Soy Ingeniero Electricista con experiencia en el diseño integral de instalaciones eléctricas y redes en media y baja tensión. En el ejercicio de mi profesión he diseñado sistemas de iluminación residencial y comercial, sistemas de fuerza, voz y datos, diseño de subestaciones para pequeñas y medianas edificaciones, sistemas de puesta a tierra, sistemas de protección contra rayos, selección y coordinación de protecciones, seguridad eléctrica, análisis de riesgos, presentación de propuestas para redes de media tensión aéreas y subterráneas desde el punto de conexión dado por el operador de red, diseño y elaboración de informes. En los proyectos en los que he participado, también he tenido experiencia en la presentación y aprobación de los mismos ante diferentes operadores de red en el país. 

Gracias a mi experiencia laboral y otros estudios realizados, tengo conocimientos básicos en mantenimiento de equipos industriales como calderas, compresores, equipos de bombeo, unidades de refrigeración, aire acondicionado y equipos para automatización de procesos industriales.
]

[Ingeniero Industrial de la Universidad Nacional de Colombia (Bogotá, 2014), con Tarjeta Profesional, Bilingüe, con 4 años de experiencia en áreas como Seguridad Industrial (Coca-Cola FEMSA), Operación y Mantenimiento Vial (Odebrecht) e Ingeniería de Proyectos (O&O Ingeniería). Experimentado en la dirección y coordinación eficiente de personal y maquinaria, apasionado por la Optimización en la Planeación y Ejecución de actividades de mantenimiento enfocado al ahorro de tiempos y recursos.

Experiencia en actividades tale como: Acompañar la implementación y mejoramiento de  los sistemas de calidad bajos las normas ISO 9001 , ISO 45001(OHSAS 18001) e ISO 14001; elaborar y hacer seguimiento del presupuestos de: Subcontratos, obras civiles, mantenimiento de equipos y vehículos; crear informes operacionales y gerenciales, planificar y controlar la ejecución de obras civiles, preparar y evaluar licitaciones, llevar su control documental, seguimiento de resultados y pago de contratistas. Cuento además con gran habilidad en el uso de herramientas informáticas incluido todo el paquete MS Office (especial habilidad en Excel y Project), AutoCAD (diseño 2D, 3D y Renders), Trimble SketchupUP (Modelamiento 3D), Revit MEP y Adobe After Effects (edición de video y creación de informes gerenciales de alto impacto).
]

[Soy Ingeniero Electrónico de la Universidad Nacional de Colombia, competente para laborar en cualquier campo relacionado con mi área de estudio o mis capacidades adquiridas en diversas ramas y conocimientos sólidos en Ciencias Básicas como Matemáticas, Física y Química y en las Áreas Administrativas y Económicas. 

Además de ser una persona respetuosa y responsable, capaz de establecer y mantener buenas relaciones interpersonales lo cual me permite desenvolverme favorablemente en cuanto al trabajo en equipo respecta, tanto en mi campo, como interdisciplinario; capaz de aceptar y escuchar sugerencias para adoptar las directrices de la institución donde me encuentre. Presento un rápido aprendizaje y muestro iniciativa y gusto por la experimentación e investigación buscando constantemente ampliar mis habilidades con el fin de evidenciar un mejoramiento continuo en mi desempeño personal y profesional. 
]

[Ingeniera industrial en la Universidad Nacional de Colombia, con altos conocimientos en el área de matemáticas y en temas de investigación de operaciones, dispuesta a obtener nuevos conocimientos y compartir el propio.

Interesada en temas relacionados con Proyectos, Calidad,  Logística y gestión de las cadenas de suministro. Razonable, responsable y honesta, con buenas aptitudes para la comunicación, la planeación, la organización y el seguimiento de objetivos trazados y de sus respectivos resultados; con un adecuado desempeño a nivel individual y grupal, gran sentido de pertenencia, compromiso y cumplimiento de labores asignadas. 
]
